(6, 'Corn', , 'Corn plant, also sometimes called mass cane, is exceptionally easy to grow, making it one of the best houseplants for beginners. Corn plant bears a thick woody trunk topped by clusters of strappy dark green leaves highlighted by a lime-green stripe down the center.');
