INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Infection and lesion formation initially occur on older leaves before progressing to newer ones. Lesions at maturity are 1/8 inch in diameter and appear light gray-colored to dark tan with a brown to purple border. Severely affected leaves wither and die from coalescing lesions. A diagnostic feature is the presence of tiny black dots (pseudostromata) that form in leaf substomatal cavities within the grayish-tan lesions. The pseudostromata produce conidiophores borne in clusters that serve as conidia-bearing structures. Pseudostromata are visible with a hand lens, and after exposure of leaves to high humidity, entire lesions appear fuzzy due to the presence of numerous conidia.', 6, 'Cercospora leaf spot');
INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Image result for bacterial spot pepperextension.umd.edu Except for virus diseases, bacterial spot is the most important disease affecting peppers in New York. A mild case of bacterial spot causes prominent necrotic spots on leaves; a severe case can cause premature leaf drop and spotting of stems and pods that results in unmarketable fruit.', 4, 'Bacterial spot');
INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Early Blight in Potato (PP1892, June 2018) Early blight of potato is caused by the fungal pathogen Alternaria solani. The disease affects leaves, stems and tubers and can reduce yield, tuber size, storability of tubers, quality of fresh-market and processing tubers and marketability of the crop.', 5, 'Early blight');
INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Late blight of potatoes and tomatoes, the disease that was responsible for the Irish potato famine in the mid-nineteenth century, is caused by the fungus-like oomycete pathogen Phytophthora infestans. It can infect and destroy the leaves, stems, fruits, and tubers of potato and tomato plants.', 5, 'Late blight');
INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Common rust is caused by the fungus Puccinia sorghi and occurs every growing season. It is seldom a concern in hybrid corn. Rust pustules usually first appear in late June. Early symptoms of common rust are chlorotic flecks on the leaf surface.', 6, 'Common rust');
INSERT INTO `plantdiseases` (`Diseaseimage`, `disesasedesc`, `plantid`, `diseasename`) VALUES
(, 'Target Spot On Tomatoes. Also known as early blight, target spot of tomato is a fungal disease that attacks a diverse assortment of plants, \r\nincluding papaya, peppers, snap beans, potatoes,\r\n cantaloupe and squash, as well as passion flower and certain ornamentals.', 7, 'Target spot');

